import { Component } from 'react';
import './style.css';

class Socials extends Component{
    constructor(){
        super()
    }



render(){


const redirectToLinkedin=()=>{}












    const redirectToFacebook = () => {
        window.location.href = 'https://www.facebook.com/husen.eyvazov?mibextid=ZbWKwL';
      };
const redirectToInstagram=()=>{
    window.location.href="https://instagram.com/huseyn.eyvazov0?igshid=OTk0YzhjMDVlZA==";
}
    return(
        <div  className='socials_container'>
            <div onClick={redirectToFacebook} id='facebook' className='social_container'>
            <img src="https://img.freepik.com/free-icon/facebook_318-566730.jpg?size=626&ext=jpg&ga=GA1.2.1249844358.1669888867&semt=sph"/>
            <div className='social_inner_container'>
                <h3>FOLLOW ME ON</h3>
                <p>SOCIAL FACEBOOK</p>
            </div>
            </div>
            <div id='Linkedin'  className='social_container'>
            <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/c/ca/LinkedIn_logo_initials.png/640px-LinkedIn_logo_initials.png" />
            <div className='social_inner_container'>
                <h3>FOLLOW ME ON</h3>
                <p>SOCIAL LINKEDIN</p>
            </div>
            </div>
            <div onClick={redirectToInstagram} id='instagram'  className='social_container'>
            <img src="https://cdn-icons-png.flaticon.com/512/733/733558.png?w=740&t=st=1683491534~exp=1683492134~hmac=41ac3e69cb442cdc69569a0b3fa7a044e00103dd597e5587495100f9919104fe" />
            <div className='social_inner_container'>
                <h3>FOLLOW ME ON</h3>
                <p>SOCIAL INSTAGRAM</p>
            </div>
            </div>
        </div>
    )
}
}
export default Socials;
